import React from "react";
import styled from "styled-components";

const Services = () => {
  return (
    <Container>
      <p>Our Servicer</p>
    </Container>
  );
};

export default Services;

const Container = styled.div`
  width: 100%;
  height: 80vh;
  background-color: #fff;
  p {
    font-family: Poppins;
    font-style: normal;
    font-weight: 300;
    font-size: 48px;
    line-height: 39%;
    /* identical to box height, or 19px */

    text-align: center;
    letter-spacing: 0.16em;

    color: #000000;
  }
`;
